        animate(0);

        window.addEventListener('keydown', (event) => {
            switch (event.key) {
                case 'ArrowUp':
                    mesh.position.y += 0.1;
                    break;
                case 'ArrowDown':
                    mesh.position.y -= 0.1;
                    break;
                case 'ArrowLeft':
                    mesh.position.x -= 0.1;
                    break;
                case 'ArrowRight':
                    mesh.position.x += 0.1;
                    break;
                case ' ':
                    if (!isJumping) {
                        velocityY = 0.2;
                        isJumping = true;
                    }
                    break;
                case 'c':
                case 'C':
                    mesh.material.color.set(Math.random() * 0xffffff); // เปลี่ยนสีแบบสุ่ม
                    break;
                case 'w':
                case 'W':
                    mesh.scale.y += 0.1; // ยืด
                    break;
                case 's':
                case 'S':
                    mesh.scale.y = Math.max(0.1, mesh.scale.y - 0.1); // หด
                    break;
                case 'r':
                case 'R':
                    mesh.scale.set(1, 1, 1); // รีเซ็ตขนาด
                    break;  
                case 'q':
                case 'Q':
                    mesh.rotation.x += 0.1; // หมุนตามแกน x
                    break;  
                case 'e':
                case 'E':   
                    mesh.rotation.x -= 0.1; // หมุนตามแกน x
                    break;
                case 'a':
                case 'A':   
                    mesh.rotation.y += 0.1; // หมุนตามแกน y
                    break;  
                case 'd':
                case 'D':   
                    mesh.rotation.y -= 0.1; // หมุนตามแกน y
                    break;  
                case 'z':
                case 'Z':       
                    mesh.rotation.z += 0.1; // หมุนตามแกน z
                    break;
                case 'x':
                case 'X':
                    mesh.rotation.z -= 0.1; // หมุนตามแกน z
                    break;
                case 't':
                case 'T':           
                    mesh.rotation.set(0, 0, 0); // รีเซ็ตการหมุน
                    break;
                case 'f':
                case 'F':
                    mesh.position.set(0, 0, 0); // รีเซ็ตตำแหน่ง
                    break;
            }
        });
